import React from "react";
import logo from "./logo.svg";
import "./App.scss";

function App() {
    return (
        <div className="App">
            <div className="LTbackground">
                <p>{UserInput()}</p>
            </div>
        </div>
    );
}

function UserInput() {
    return <h2 class="test">Hello</h2>;
}

export default App;
